import { Route, Routes } from 'react-router-dom';
import './App.css';
import AboutUs from './root-folder/pages/AboutUs';
import Home from './root-folder/pages/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="AboutUs" element={<AboutUs />} />
      </Routes>
      <Home />
      </BrowserRouter>
  );
}

export default App;
